import { useDispatch } from "react-redux";
import { api, database, fetchDogs } from "../../store/actions/actions";

export default function FilterDbApi() {
  let dispatch = useDispatch();

  const handleClick = (fn) => {
    dispatch(fn());
  };

  return (
    <div className="apidb">
      <button
        onClick={() => handleClick(fetchDogs)}
        className={(active) => (active ? "button" : "")}
      >
        All
      </button>
      <button onClick={() => handleClick(api)} className="button">
        Api
      </button>
      <button onClick={() => handleClick(database)} className="button">
        Database
      </button>
    </div>
  );
}
